Justified - Season 5 of 6

Plot

The fifth season of the American television drama series Justified premiered on January 7, 2014, on FX, and concluded on April 8, 2014, consisting of 13 episodes.[1] The series was developed by Graham Yost based on Elmore Leonard's novels Pronto and Riding the Rap and his short story &quot;Fire in the Hole&quot;.[2] Its main character is Raylan Givens, a deputy U.S. Marshal. Timothy Olyphant portrays Givens, a tough federal lawman, enforcing his own brand of justice in his Kentucky hometown.[2] The series is set in the city of Lexington, Kentucky, and the hill country of eastern Kentucky, specifically in and around Harlan.[3] The fifth season was released on DVD and Blu-ray in region 1 on December 2, 2014.[4]


